import React from 'react';
import ItemCard from '../../components/ui/ItemCard';
import { ThemeContext } from "../../context/Theme";
import { useContext, useState } from 'react';

export const AdminAddItem = ({setSelected}) => {
    const [theme] = useContext(ThemeContext);

    return (
        <>
        <div className="col-span-8 overflow-hidden rounded-lg text-xs md:text-md w-64 px-8 sm:w-full h-full">
    <div className="flex justify-between items-center py-4">
        <h1 className="text-3xl font-bold">Items</h1>
        <button 
                onClick= {()=>{setSelected("Items")}}
                className="rounded-lg px-4">
                    <i class="fa-solid fa-circle-chevron-left text-3xl"></i>
                </button>   
    </div>
    <div className="flex bg-white items-center justify-center w-full p-8 rounded-lg shadow-lg">
      <div className="flex items-center">
        <div className>
          <input type="file" accept="image/*" />
          <img src="https://source.unsplash.com/random" alt="Uploaded" className="mt-4" />
        </div>
        <div>
          <input type="text" placeholder="Name" className="w-full border border-gray-300 p-2 rounded-lg mb-4" />
          <input type="text" placeholder="Email" className="w-full border border-gray-300 p-2 rounded-lg mb-4" />
          <input type="text" placeholder="Phone" className="w-full border border-gray-300 p-2 rounded-lg mb-4" />
          <input type="text" placeholder="Address" className="w-full border border-gray-300 p-2 rounded-lg mb-4" />
          <button className="bg-black px-6 py-2 text-white rounded-lg">Submit</button>
        </div>
      </div>
    </div>
</div>

</>
);
};


export default AdminAddItem;
